{% block title %}product lists{% endblock %}

{% block body %}
    <h1>product lists</h1>
    
    {% for message in app.flashes('success') %}
\t<div class=\"alert alert-primary\">
\t\t{{ message }}
\t</div>
    {% endfor %}


    <div style=\"text-align: right; margin-bottom: 20px;\">
        <a href=\"{{path('produit_new')}}\">
            <button class=\"btn btn-success\">

                <i class=\"fas fa-plus\" style=\"margin-right: 5px; \"></i>
                New product
            </button>
        </a>
    </div>

    <table class=\"table\" data-toggle=\"table\" data-search=\"true\" data-show-columns=\"true\" data-pagination=\"true\">
        <thead>
            <tr>
                <th data-sortable=\"true\" data-field=\"id\">ID</th>
                <th>Code</th>
                <th>Designation</th>
                <th>Description</th>
                <th>Prix</th>
                <th>Quantit√©</th>
                <th>Remise</th>
                <th>Image</th>
                <th>actions</th>
            </tr>
        </thead>
        <tbody>
        {% for produit in produits %}
            <tr>
                <td>{{ produit.id }}</td>
                <td>{{ produit.Code }}</td>
                <td>{{ produit.designation }}</td>
                <td>{{ produit.description }}</td>
                <td>{{ produit.Prix }}</td>
                <td>{{ produit.quantite }}</td>
                <td>{{ produit.remise }}</td>
                <td>{{ produit.image }}</td>
                <td>
                    <a href=\"{{ path('produit_show', {'id': produit.id}) }}\" class=\"btn btn-success\"><i class=\"fas fa-eye\"></i></a>
                    <a href=\"{{ path('produit_edit', {'id': produit.id}) }}\" class =\"btn btn-warning\"><i class=\"far fa-edit\"></i></a>
                </td>
            </tr>
        {% else %}
            <tr>
                <td colspan=\"9\">no records found</td>
            </tr>
        {% endfor %}
        </tbody>
    </table>

{% endblock %}
